function checkIDCard(type, id) {
  /*
                                "10": "身份证",
                                "20": "护照",
                                "11": "军官证",
                                "12": "士兵证",
                                "13": "警官证",
                                "14": "港澳居民来往内地通行证",
                                "15": "台湾居民来往大陆通行证",
                                "16": "香港身份证",
                                "17": "澳门身份证",
                                "18": "台湾身份证",
                                */
  if (type === '10') {// 身份证
    var regIdCard =
    /^[1-9]\d{7}((0\d)|(1[0-2]))(([0|1|2]\d)|3[0-1])\d{3}$|^[1-9]\d{5}[1-9]\d{3}((0\d)|(1[0-2]))(([0|1|2]\d)|3[0-1])\d{3}([0-9]|X)$/;
    if (!regIdCard.test(id)) {
      return false;
    } else {
      return true;
    }
  } else if (type === '20') {// 普通护照
    return id.length != 0;
  } else if (type == '14') {// 
    return id.length == 11;
  } else if (type == '15') {
    return id.length == 8;
  } else {
    // 其余的没法判断
    return id.length != 0;
  }
}

